A music video has already been shot with Williams. B.o.B shot his scenes for the video in April, but Williams was only able to shoot her parts after the end of Paramore's spring tour, so they were never in the same room during filming. The music video, directed by Hiro Murai, premiered on iTunes on Tuesday June 15, 2010. The video features several frames of B.o.B rapping his verses in a party setting, on stage, and room filled with lights and occasional song lyrics while Hayley Williams sings the hook in a light filled room and walking through photographs.
